                    return (int)Animation_FieldIndex.Flavor;
                }
                case RecordTypeInts.QUAL:
                {
                    _UseDialogueAnimationLocation = (stream.Position - offset);
                    return (int)Animation_FieldIndex.UseDialogueAnimation;
                }
                case RecordTypeInts.DOFT:
                {
